    <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1">
    <title>Dustmoo Gridster Demo</title>
    <meta name="description" content="">

    <!-- Place favicon.ico and apple-touch-icon.png in the root directory -->

    <link rel="stylesheet" href="css/normalize_gridster.css">
    <link rel="stylesheet" href="css/main.css">
    <link rel="stylesheet" href="css/builder.css">
    <script src="http://ajax.googleapis.com/ajax/libs/jquery/1.7.1/jquery.min.js"></script>
    <script src="js/jquery.gridster.with-extras.min.js"></script>

    <script type="text/javascript">
        function myfunction(){
            localStorage.clear();
            window.location.reload();

    </script>

<body>
    <section class="demo">

        <div class="controls">
            <div class="saving">
                <div>
                    <span class="input_wrapper btn icon-reset"><input id="def_button" class="btn" type="button" value="Reset" onclick="myfunction()"></span>
                    <button id="seralize" class="btn"><span class="icon-lock"></span>Save</button>
                </div>
            </div>
            <div class="build">
                <div class="adding">
                    <button id="delete_top" class="btn"><span class="icon-remove"></span>Delete Last Row</button>
                    <button id="add_block" class="btn"><span class="icon-add"></span>Blocks</button>
                    <button id="add_div" class="btn"><span class="icon-add"></span>Dividers</button>
                </div>
                <hr>
                <div class="adjusters">
                    <button class="btn block_unlock"><span class="icon-edit"></span>Boxes</button>
                    <button class="btn div_unlock"><span class="icon-edit"></span>Divider</button>
                    <button class="btn div_noped"><span class="icon-nope"></span>Last</button>
                    <hr>
                    <button class="btn spanner2_unlock"><span class="icon-edit"></span>2x Spans</button>
                    <button class="btn spanner3_unlock"><span class="icon-edit"></span>3x Spans</button>
                </div>
            </div>
        </div>
